import axios from "axios";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import swal from 'sweetalert2';

const URI = "http://localhost:8000/recipes/";
const URI2 = "http://localhost:8000/categories/";

const CompCreateRecipes = () => {
    
        const [nombre, setNombre] = useState('');
        const [descripcion, setDescripcion] = useState('');
        const [tiempo, setTiempo] = useState('');
        const [instrucciones, setInstrucciones] = useState('');
        const [informacion, setInformacion] = useState('');
        const [categorias, setCategoria] = useState([]);
        const [selectedCategoria, setSelectedCategoria] = useState('');
        const navigate = useNavigate();

        useEffect( ()=>{
            getCategories()
        },[])

        //Obtener Categorias
        const getCategories = async () => {
            const res = await axios.get(URI2);
            setCategoria(res.data);
        }

    
        //Guardar Receta
    
        const store = async (e) => {
            e.preventDefault();

            const recipe = {
                nombre_receta: nombre,
                descripcion_receta: descripcion,
                tiempo_preparacion: tiempo,
                intrucciones: instrucciones,
                informacion_nutricional: informacion,
                id_categoria: selectedCategoria 
            }

            console.log(recipe);
            // const result = await axios.post(URI, recipe);
            // if(!result.data.success){
            //     return swal.fire({
            //         title: 'Error!',
            //         text: result.data.message,
            //         icon: 'error',
            //         confirmButtonText: 'OK'
            //     })
            // }else{
            //     return swal.fire({
            //         title: 'Exito!',
            //         text: result.data.message,
            //         icon: 'success',
            //         confirmButtonText: 'OK'
            //     }).then((result) => {
            //         if (result.isConfirmed) {
            //             navigate('/recipes');
            //         }
            //     })
            // }
        }

        const añadirCategoria = async () => {
            const res = await axios.post(URI2, categorias);
            if(!res.data.success){
                return swal.fire({
                    title: 'Error!',
                    text: res.data.message,
                    icon: 'error',
                    confirmButtonText: 'OK'
                })
            }else{
                return swal.fire({
                    title: 'Exito!',
                    text: res.data.message,
                    icon: 'success',
                    confirmButtonText: 'OK'
                }).then((res) => {
                    if (res.isConfirmed) {
                        navigate('/recipes/create');
                    }
                })
            }
        }

    return(

        <div>
            <h3>Registrar Receta</h3>
            <form onSubmit={store}>
                <div className="mb-3">
                    <label>Nombre</label>
                    <input type="text" className="form-control" onChange={(e)=>setNombre(e.target.value)} value={nombre}/>
                </div>
                <div className="mb-3">
                    <label>Descripcion</label>
                    <input type="text" className="form-control" onChange={(e)=>setDescripcion(e.target.value)} value={descripcion}/>
                </div>
                <div className="mb-3">
                    <label>Tiempo de preparacion</label>
                    <input type="text" className="form-control" onChange={(e)=>setTiempo(e.target.value)} value={tiempo}/>
                </div>
                <div className="mb-3">
                    <label>Instrucciones</label>
                    <input type="text" className="form-control" onChange={(e)=>setInstrucciones(e.target.value)} value={instrucciones}/>
                </div>
                <div className="mb-3">
                    <label>Informacion nutricional</label>
                    <input type="text" className="form-control" onChange={(e)=>setInformacion(e.target.value)} value={informacion}/>
                </div>
                <div className="mb-3">
                    <select className="form-control" onChange={(e)=>setSelectedCategoria(e.target.value)} required>
                        <option>Seleccionar una categoria...</option>
                        {categorias.map(categoria => (
                            <option key={categoria.id} value={categoria.id}>{categoria.nombre_categoria}</option>
                        ))}
                    </select>
                    <button type="button" className="btn btn-success" onClick={()=>añadirCategoria()}>Añadir Categoria</button>
                </div>
                <button type="submit" className="btn btn-primary">Guardar</button>
            </form>
        </div>

    )

}

export default CompCreateRecipes;
